import React from "react";
import DynamicImport from "../../utils/dynamicComponent";
import Preloader from "../../atoms/preloader/Preloader";

export const Expired = props => (
  <DynamicImport load={() => import("../bookingHost/expire/Expired")}>
    {DNcompoent =>
      DNcompoent === null ? <Preloader page /> : <DNcompoent {...props} />
    }
  </DynamicImport>
);

export const Sms = props => (
  <DynamicImport load={() => import("../bookingHost/sms/SmsWrap")}>
    {DNcompoent =>
      DNcompoent === null ? <Preloader page /> : <DNcompoent {...props} />
    }
  </DynamicImport>
);

export const DashBoard = props => (
  <DynamicImport load={() => import("../bookingHost/dashboard/DashBoardWrap")}>
    {DNcompoent =>
      DNcompoent === null ? (
        <Preloader page loading={true} />
      ) : (
        <DNcompoent {...props} />
      )
    }
  </DynamicImport>
);

export const HMconfig = props => (
  <DynamicImport
    load={() => import("./bookingHost/HMconfig/HMconfigWrap.tsx")}
  >
    {DNcompoent =>
      DNcompoent === null ? (
        <Preloader page loading={true} />
      ) : (
        <DNcompoent {...props} />
      )
    }
  </DynamicImport>
);

export const ResvList = props => (
  <DynamicImport load={() => import("../bookingHost/resvList/ResvListWrap")}>
