);

export const SmsHistory = props => (
  <DynamicImport
    load={() => import("../bookingHost/smsHistory/SmsHistoryWrap")}
  >
    {DNcompoent =>
      DNcompoent === null ? <Preloader page /> : <DNcompoent {...props} />
